这简直比A+B还简单。。。。

给一个数，输出48减去这个数。
```
#include<iostream>
using namespace std;
int main(){
    int a;
    cin>>a;
    cout<<48-a<<endl;
}
```

这道题目实现了A-B（简单的= =）

给出代码：

```
#include<iostream>
using namespace std;
int main()
{
	int a=48;     //定义
	cin>>b;        //输入
	cout<<a-b;    //输出a-b
	return 0;
}
```
看，是不是很简单？
